import { BrowserRouter, Routes, Route, Navigate } from "react-router-dom";
import React from "react";
import Sidebar from "./Sidebar"; // Adjust the path if necessary
import UserManagement from "./UserManagement"; // Adjust the path if necessary
import "../../../Styles/AdminUser.css"; // Add your AdminUser CSS

const Container = styled.div`
    width: 100vw;
    display: flex;
    justify-content: center;
`;
const Section = styled.div`
    width: 60%;
`;
const Menu = styled.div`
    width: 100%;
`;
const ContentBox = styled.div`
    width: 100%;
    margin-top: 30px;
`;

export function Admin() {
    return (
        <>
            <BrowserRouter>
                <Container>
                    <Section>
                        <Menu>
                            <Sidebar />
                        </Menu>
                        <ContentBox>
                            <Routes>
                                <Route path="/admin/user" element={<UserManagement />} />
                                <Route path="/admin/lecture" element={<LectureManagement />} />
                                <Route path="/admin/enrollment" element={<EnrollmentManagement />} />
                            </Routes>
                        </ContentBox>
                    </Section>
                </Container>
            </BrowserRouter>
        </>
    );
}

export default Admin;
